// Importing necessary libraries and components
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './components/HomePage';

// Main App component
function App() {
    return (
        <Router>
            <Routes>
                {/* Route for Home Page */}
                <Route path="/" element={<HomePage />} />
            </Routes>
        </Router>
    );
}

export default App;
